import React, { useState, useEffect, useContext } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import AuthContext from '../contexts/AuthContext';
import { Container, Row, Col, Card, Button, Form, Pagination } from 'react-bootstrap';

interface Marca {
  id: number;
  nome: string;
}

interface Modelo {
  id: number;
  nome: string;
}

interface Carro {
  id: number;
  marca: Marca;
  modelo: Modelo;
  ano: number;
  preco: number;
  quilometragem: number;
}

function CarList() {
  const [carros, setCarros] = useState<Carro[]>([]);
  const [marcas, setMarcas] = useState<Marca[]>([]);
  const [marcaFiltro, setMarcaFiltro] = useState<string>('');
  const [anoFiltro, setAnoFiltro] = useState<string>('');
  const [pagina, setPagina] = useState<number>(1);
  const [totalPaginas, setTotalPaginas] = useState<number>(1);
  const { user, logout } = useContext(AuthContext);

  useEffect(() => {
    fetchCarros();
    fetchMarcas();
  }, [marcaFiltro, anoFiltro, pagina]);

  const fetchCarros = async () => {
    const response = await axios.get('/api/carros', {
      params: {
        marca: marcaFiltro,
        ano: anoFiltro,
        page: pagina
      }
    });
    setCarros(response.data.data);
    setTotalPaginas(response.data.last_page);
  };

  const fetchMarcas = async () => {
    const response = await axios.get('/api/marcas');
    setMarcas(response.data);
  };

  const handleDelete = async (id: number) => {
    await axios.delete(`/api/carros/${id}`);
    fetchCarros();
  };

  const handlePageChange = (pageNumber: number) => {
    setPagina(pageNumber);
  };

  return (
    <Container>
      <Row className="my-4">
        <Col>
          <h1>Lista de Carros</h1>
          {user ? (
            <div className="mb-3">
              <Button variant="primary" onClick={logout}>Logout</Button>
              <Link to="/novo" className="btn btn-success ml-3">Adicionar Carro</Link>
            </div>
          ) : (
            <div className="mb-3">
              <Link to="/login" className="btn btn-primary">Login</Link>
              <Link to="/register" className="btn btn-secondary ml-3">Register</Link>
            </div>
          )}
          <Form className="mb-3">
            <Row>
              <Col>
                <Form.Group controlId="marcaFiltro">
                  <Form.Label>Marca</Form.Label>
                  <Form.Control as="select" value={marcaFiltro} onChange={(e) => setMarcaFiltro(e.target.value)}>
                    <option value="">Todas as Marcas</option>
                    {marcas.map(marca => (
                      <option key={marca.id} value={marca.nome}>{marca.nome}</option>
                    ))}
                  </Form.Control>
                </Form.Group>
              </Col>
              <Col>
                <Form.Group controlId="anoFiltro">
                  <Form.Label>Ano</Form.Label>
                  <Form.Control type="number" value={anoFiltro} onChange={(e) => setAnoFiltro(e.target.value)} placeholder="Ano" />
                </Form.Group>
              </Col>
            </Row>
          </Form>
        </Col>
      </Row>
      <Row>
        {carros.map(carro => (
          <Col key={carro.id} sm={6} md={4} lg={3} className="mb-4">
            <Card>
              <Card.Body>
                <Card.Title>{carro.marca.nome} {carro.modelo.nome}</Card.Title>
                <Card.Text>
                  Ano: {carro.ano}<br />
                  Preço: R$ {carro.preco}<br />
                  Quilometragem: {carro.quilometragem} km
                </Card.Text>
                <Link to={`/carros/${carro.id}`} className="btn btn-info">Detalhes</Link>
                {user && (
                  <div className="mt-2">
                    <Link to={`/editar/${carro.id}`} className="btn btn-warning mr-2">Editar</Link>
                    <Button variant="danger" onClick={() => handleDelete(carro.id)}>Excluir</Button>
                  </div>
                )}
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
      <Row>
        <Col>
          <Pagination>
            {[...Array(totalPaginas).keys()].map(number => (
              <Pagination.Item key={number+1} active={number+1 === pagina} onClick={() => handlePageChange(number+1)}>
                {number+1}
              </Pagination.Item>
            ))}
          </Pagination>
        </Col>
      </Row>
    </Container>
  );
}

export default CarList;
